const initialState = [
    {
        title: "Aprovados",
        id: 0,
        cards: [
            {
                id: 0,
                text: "card 0"
            },
            {
                id: 1,
                text: "card 1"
            }
        ]
    },
    {
        title: "Em andamento",
        id: 1,
        cards: [
            {
                id: 0,
                text: "card 0"
            },
            {
                id: 1,
                text: "card 1"
            },
            {
                id: 2,
                text: "card 2"
            }
        ]
    },
    {
        title: "Concluído",
        id: 1,
        cards: [
            {
                id: 0,
                text: "card 0"
            },
            {
                id: 1,
                text: "card 1"
            },
            {
                id: 2,
                text: "card 2"
            }
        ]
    }
];

const listsReducer = (state = initialState, action) => {
    switch(action.type) {
        default:
            return state;
    }
}

export default listsReducer;
